import MomentInput from "react-moment-input";

function Timepicker() {
  return (
    <MomentInput
      max={moment().add(1, "days")}
      min={moment()}
      format="YYYY-MM-DD"
      options={true}
      readOnly={false}
      icon={false}
      onChange={(date) => {
        console.log(date);
      }}
    />
  );
}

export default Timepicker;
